import React from 'react'

const AddTodo = () => {
    return (
        <div className='container col-5 mt-5 p-4 shadow p-2 mb-3 bg-body-tertiary rounded'>
            <div className='mb-3'>
                <h1 className='text-center'>Add Todo</h1>
            </div>
            <div class="mb-3">
                <label for="title" class="form-label">Title</label>
                <input type="text" class="form-control" id="title" placeholder="Enter Task Title here"/>
            </div>
        </div>
    )
}

export default AddTodo;
